import React from 'react';
import { Grommet } from 'grommet';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Header } from './Header';
const theme = {
	global: {
		colors: {
			brand: '#339C51'
		},
		font: {
			family: 'Poppins',
			size: '18px',
			height: '20px'
		}
	}
};

function App() {
	return (
		<Grommet theme={theme}>
            <Header/>
			<Router></Router>
		</Grommet>
	);
}

export default App;
